import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Button,
  Container,
  Form,
  Row,
  Col,
  FormGroup,
  Nav,
  NavItem
} from "react-bootstrap";
import Sidebar from "react-bootstrap-sidebar";
import "../../css/grubhub.css";

class OwnerSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <Sidebar side="left" isVisible={true} onHide={false}>
          <Nav>
            <NavItem href="#">Account Info</NavItem>
            <NavItem href="#">Link 2</NavItem>
            <NavItem href="#">Link 3</NavItem>
            <NavItem href="#">Link 4</NavItem>
          </Nav>
        </Sidebar>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(OwnerSignUp);
